const Quiz = () => {
  return (
    <div>
      <p className={classes.heading-txt}>Quiz APP</p>
      <div className={classes.container}>
        <div className={classes.question}></div>
        <div className={classes.option-container}></div>
      </div>
    </div>
  );
};
export default Quiz;
